define('text!views/information/index.html',[],function () { return '<div class="row collapse">\r\n    <div class="large-12 columns">\r\n        <table class="bumped">\r\n            <thead>\r\n                <tr>\r\n                    <th>Information</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody>\r\n                <tr>\r\n                    <td>\r\n                        <a data-bind="fastlink: \'/#/information/terms\'">\r\n                            <span>Terms & Conditions</span>\r\n                            <span class="right">&#62</span>\r\n                        </a>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>\r\n                        <a data-bind="fastlink: \'/#/information/instructions\'">\r\n                            <span>Using Hokie Swap</span>\r\n                            <span class="right">&#62</span>\r\n                        </a>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>\r\n                        <a data-bind="fastlink: \'mailto: supportvpf@vt.edu?subject=Hokie Swap | Bug report\'">\r\n                            <span>Report a bug</span>\r\n                            <span class="right">&#62</span>\r\n                        </a>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n    </div>\r\n</div>';});


define('text!views/information/instructions.html',[],function () { return '<div class="row viewBackground">\r\n    <div class="large-12 columns">\r\n        <h2 class="swapHeadline">Using Hokie Swap</h2>\r\n\r\n        <div class="flex-video widescreen">\r\n            <iframe src="https://www.youtube.com/embed/xSJ4EP_A-1A?rel=0&hd=1" frameborder="0" allowfullscreen></iframe>\r\n        </div>\r\n    </div>\r\n</div>\r\n';});


define('text!views/information/terms.html',[],function () { return '<div class="row viewBackground">\r\n    <div class="large-12 columns">\r\n        <h2 class="swapHeadline">Terms & Conditions</h2>\r\n\r\n        <p>Hokie Swap is a free service offered by Virginia Tech Surplus Property Management to foster the efficient redistribution of property, cost savings and recycling.  This app is not open to the public and may be used only to make internal distributions within the Virginia Tech organization.</p>\r\n\r\n        <p>All items remain the property of Virginia Tech and are not for personal use.</p>\r\n\r\n        <h5>Instructions</h5>\r\n\r\n        <p>Create a new posting to advertise an item or to request an item from the community.  Items may be offered for free or you may elect to ask for an internal transfer of funds.  There are to be no cash transactions whatsoever.</p>\r\n\r\n        <p>You may delete your post if it is no longer needed.  Posts will be automatically deleted after 21 days.</p>\r\n\r\n        <p>If an item is not successfully redistributed, the department is required to fill out a surplus report form to enable the items final disposition. Please note that use of Hokie Swap and the surplus report form  are NOT to be done simultaneously.  Only one type of disposal is allowed at a time.</p>\r\n\r\n        <p>If fixed asset equipment is redistributed, it is the seller\'s responsibility to notify Fixed Asset Management to update inventory records.</p>\r\n\r\n        <p>We hope that you benefit from this app.  Comments and suggestions may be directed to <a href="mailto: csherman@exchange.vt.edu?subject=Hokie Swap">Chris Sherman</a>.</p>\r\n    </div>\r\n</div>';});


