define('text!views/posts/details.html',[],function () { return '<div class="row viewBackground">\r\n    <div class="large-12 columns" data-bind="with: item">\r\n        <h2 class="swapHeadline" data-bind="text: Title"></h2>\r\n\r\n        <p class="pre" data-bind="text: Description"></p>\r\n\r\n        <p data-bind="visible: Price > 0, text: \'Price: $\' + Price"></p>\r\n\r\n        <div class="row" data-bind="if: Photos().length > 0">\r\n            <div class="large-1 small-12 columns">\r\n                <!-- ko foreach: Photos -->\r\n                <p>\r\n                    <img data-bind="attr: { src: Source }, fastbutton: $root.selectPhoto" />\r\n                </p>\r\n                <!--/ko-->\r\n            </div>\r\n            <div class="large-11 columns hide-for-small" data-bind="with: $root.selectedPhoto">\r\n                <img data-bind="attr: { src: Source }" />\r\n            </div>\r\n        </div>\r\n\r\n        <h5>Contact information</h5>\r\n\r\n        <ul>\r\n            <li><a data-bind="attr: { href: \'mailto:\' + Email + \'?subject=Hokie Swap: \' + Title() }, text: Email"></a></li>\r\n            <li data-bind="visible: Phone(), text: Phone()"></li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n\r\n<div class="row">\r\n    <div class="large-12 columns">\r\n        <label class="error" data-bind="text: error"></label>\r\n    </div>\r\n</div>\r\n';});


