define('text!views/posts/manage.html',[],function () { return '<div class="row" data-bind="if: error !== undefined">\r\n    <div class="large-12 columns">\r\n        <label class="error" data-bind="text: error"></label>\r\n    </div>\r\n</div>\r\n\r\n<div class="row collapse">\r\n    <div class="large-12 columns">\r\n\r\n        <table class="bumped">\r\n            <thead>\r\n                <tr>\r\n                    <th>Active Posts</th>\r\n                    <th class="right" data-bind="fastbutton: toggleEditItems">\r\n                        <i data-bind="css: editItems() ? \'fi-x\' : \'fi-trash\', visible: items().length > 0"></i>\r\n                    </th>\r\n                </tr>\r\n            </thead>\r\n            <tbody data-bind="foreach: items, visible: items().length > 0">\r\n                <tr>\r\n                    <td colspan="2">\r\n                        <a data-bind="fastbutton: $root.selectItem">\r\n                            <span data-bind="text: Title"></span>\r\n                            <span class="right" data-bind="ifnot: $root.editItems">&#62</span>\r\n                            <span class="right" data-bind="if: $root.editItems">\r\n                                <i class="fi-trash"></i>\r\n                            </span>\r\n                        </a>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n            <tbody data-bind="visible: items().length === 0">\r\n                <tr>\r\n                    <td colspan="2">\r\n                        <a><span>No records</span></a>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n    </div>\r\n</div>\r\n\r\n<div class="row collapse">\r\n    <div class="large-12 columns">\r\n\r\n        <table class="bumped">\r\n            <thead>\r\n                <tr>\r\n                    <th>Expired Posts</th>\r\n                    <th class="right" data-bind="fastbutton: toggleEditItems">\r\n                        <i data-bind="css: editItems() ? \'fi-x\' : \'fi-trash\', visible: expiredItems().length > 0"></i>\r\n                    </th>\r\n                </tr>\r\n            </thead>\r\n            <tbody data-bind="foreach: expiredItems, visible: expiredItems().length > 0">\r\n                <tr>\r\n                    <td colspan="2">\r\n                        <a data-bind="click: $root.renewItem">\r\n                            <span data-bind="text: Title"></span>\r\n                            <span class="right" data-bind="ifnot: $root.editItems">Renew</span>\r\n                            <span class="right" data-bind="if: $root.editItems">\r\n                                <i class="fi-trash"></i>\r\n                            </span>\r\n                        </a>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n            <tbody data-bind="visible: expiredItems().length === 0">\r\n                <tr>\r\n                    <td colspan="2">\r\n                        <a><span>No records</span></a>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n    </div>\r\n</div>\r\n';});


