define('text!views/shared/_basics.html',[],function () { return '<div class="row viewBackground">\r\n    <div class="large-12 columns">\r\n        <section data-bind="with: item">\r\n            <h2 class="swapHeadline">Basic information</h2>\r\n\r\n            <div class="row">\r\n                <div class="large-4 columns">\r\n                    <label for="Type">\r\n                        Type\r\n                    </label>\r\n                    <select name="Type" data-bind="value: Type">\r\n                        <option value="1">Advertisement</option>\r\n                        <option value="2">Request</option>\r\n                    </select>\r\n                </div>\r\n            </div>\r\n\r\n            <div class="row">\r\n                <div class="large-4 columns">\r\n                    <label for="Category">\r\n                        Category\r\n                    </label>\r\n                    <select name="Category" data-bind="foreach: $root.categories, value: CategoryId">\r\n                        <option data-bind="attr: { value: Id }, text: Name"></option>\r\n                    </select>\r\n                </div>\r\n            </div>\r\n\r\n            <div class="row">\r\n                <div class="large-6 columns">\r\n                    <label for="Title">\r\n                        Title<span class="required">*</span>\r\n                        <span class="right" data-bind="text: $parent.titleCountdown"></span>\r\n                    </label>\r\n                    <input name="Title" type="text" required\r\n                        data-bind="value: Title, valueUpdate: \'afterkeydown\', blurOnEnter: true,\r\n                        attr: { maxlength: $parent.titleMaxLength }" />\r\n                </div>\r\n            </div>\r\n\r\n            <label class="error" data-bind="text: $root.error"></label>\r\n            <span class="textButton" data-bind="click: $root.validateBasics">\r\n                Continue</span>\r\n        </section>\r\n    </div>\r\n</div>\r\n';});


define('text!views/shared/_column.html',[],function () { return '<div class="large-12 columns postBuffer">\r\n    <!-- ko foreach: Photos -->\r\n    <img class="img-frame" data-bind="attr: { src: Source }" />\r\n    <!--/ko-->\r\n    <a data-bind="fastbutton: $root.selectItem">\r\n        <div data-bind="css: { defaultPanel: Type === 1, requestPanel: Type === 2 }">\r\n            <p class="text-center" data-bind="text: Title"></p>\r\n        </div>\r\n    </a>\r\n\r\n    <div class="hide detailPanel" data-bind="attr: { id: Id }">\r\n        <p class="pre" data-bind="text: Description"></p>\r\n\r\n        <p class="zeroMargin"><strong>Contact information</strong></p>\r\n        <ul class="zeroMargin">\r\n            <li><a data-bind="attr: { href: \'mailto:\' + Email + \'?subject=Hokie Swap: \' + Title() }, text: Email"></a></li>\r\n            <li data-bind="visible: Phone(), text: Phone()"></li>\r\n        </ul>\r\n    </div>\r\n\r\n    <a data-bind="fastbutton: $root.selectItem">\r\n        <div class="teaserPanel">\r\n            <span class="left" data-bind="text: moment(DateTimeCreated).fromNow()"></span>\r\n            <span class="right" data-bind="text: Price ? \'$\' + Price : \'\'"></span>\r\n        </div>\r\n    </a>\r\n</div>\r\n';});


define('text!views/shared/_contact.html',[],function () { return '<div class="row viewBackground">\r\n    <div class="large-12 columns">\r\n\r\n        <section data-bind="with: item">\r\n            <h2 class="swapHeadline">Contact information</h2>\r\n\r\n            <div class="row">\r\n                <div class="large-4 columns">\r\n                    <label for="Email">\r\n                        Email<span class="required">*</span>\r\n                    </label>\r\n                    <input name="Email" type="email" data-bind="value: Email, blurOnEnter: true" required maxlength="50" />\r\n                </div>\r\n            </div>\r\n\r\n            <div class="row">\r\n                <div class="large-4 columns">\r\n                    <label for="Phone">\r\n                        Phone\r\n                    </label>\r\n                    <input name="Phone" type="tel" data-bind="value: Phone, blurOnEnter: true" maxlength="15" />\r\n                </div>\r\n            </div>\r\n\r\n            <label class="error" data-bind="text: errorMessage"></label>\r\n            <label class="error" data-bind="text: $root.error"></label>\r\n            <span class="textButton"\r\n                 data-bind="click: $root.validateContact">Save</span>\r\n        </section>\r\n    </div>\r\n</div>\r\n';});


define('text!views/shared/_details.html',[],function () { return '<div class="row viewBackground">\r\n    <div class="large-12 columns">\r\n        <section data-bind="with: item">\r\n            <h2 class="swapHeadline">Item details</h2>\r\n\r\n            <div class="row">\r\n                <div class="large-8 columns">\r\n                    <label for="Description">\r\n                        Description<span class="required">*</span>\r\n                        <span class="right" data-bind="text: $parent.descriptionCountdown"></span>\r\n                    </label>\r\n                    <textarea name="Description" required\r\n                        data-bind="value: Description, valueUpdate: \'afterkeydown\',\r\n                        attr: { maxlength: $parent.descriptionMaxLength }"></textarea>\r\n                </div>\r\n            </div>\r\n\r\n            <div class="row">\r\n                <div class="large-4 columns">\r\n                    <label for="Price">\r\n                        Price\r\n                    </label>\r\n                    <input name="Price" type="text" data-bind="value: Price, blurOnEnter: true" required maxlength="10" />\r\n                </div>\r\n            </div>\r\n\r\n            <label class="error" data-bind="text: $root.error"></label>\r\n            <span class="textButton" data-bind="click: $root.validateDetails">\r\n                Continue</span>\r\n        </section>\r\n    </div>\r\n</div>\r\n';});


define('text!views/shared/_icon-bar.html',[],function () { return '<nav class="icon-bar">\r\n    <ul data-bind="foreach: router.navigationModel">\r\n        <li data-bind="css: { active: isActive }">\r\n            <a data-bind="fastlink: hash">\r\n                <i data-bind="attr: { class: icon }"></i>\r\n            </a>\r\n        </li>\r\n    </ul>\r\n</nav>\r\n';});


define('text!views/shared/_photos.html',[],function () { return '<div class="row viewBackground">\r\n    <div class="large-12 columns">\r\n        <h2 class="swapHeadline">Photos</h2>\r\n\r\n        <form name="fileInputForm">\r\n            <input type="file" name="files[]" multiple\r\n                 data-bind="event: { onload: window.fileInputForm.reset(), change: postPhotos }" />\r\n        </form>\r\n\r\n        <label class="error" data-bind="text: error"></label>\r\n\r\n        <div class="row" data-bind="with: item">\r\n            <div class="large-12 columns" data-bind="foreach: Photos">\r\n                <p class="th radius upload-container" data-bind="visible: !$data.destroy()">\r\n                    <img class="upload-preview" data-bind="attr: { src: Source }" />\r\n                    <i class="fi-x close" data-bind="confirmDelete: $parents[1].removePhoto"></i>\r\n                </p>\r\n            </div>\r\n        </div>\r\n\r\n        <span class="textButton"\r\n            data-bind="click: continueNavigation">\r\n            Continue</span>\r\n    </div>\r\n</div>\r\n';});


define('text!views/shared/_post-list.html',[],function () { return '<div class="row hide-for-small">\r\n    <div class="large-3 columns">\r\n        <div class="row" data-bind="foreach: columnOneItems">\r\n            <!-- ko compose: { view: \'shared/_column\' } -->\r\n            <!--/ko-->\r\n        </div>\r\n    </div>\r\n\r\n    <div class="large-3 columns">\r\n        <div class="row" data-bind="foreach: columnTwoItems">\r\n            <!-- ko compose: { view: \'shared/_column\' } -->\r\n            <!--/ko-->\r\n        </div>\r\n    </div>\r\n\r\n    <div class="large-3 columns">\r\n        <div class="row" data-bind="foreach: columnThreeItems">\r\n            <!-- ko compose: { view: \'shared/_column\' } -->\r\n            <!--/ko-->\r\n        </div>\r\n    </div>\r\n\r\n    <div class="large-3 columns">\r\n        <div class="row" data-bind="foreach: columnFourItems">\r\n            <!-- ko compose: { view: \'shared/_column\' } -->\r\n            <!--/ko-->\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<div class="row show-for-small">\r\n    <div class="small-12 columns">\r\n        <div class="row" data-bind="foreach: items">\r\n            <!-- ko compose: { view: \'shared/_column\' } -->\r\n            <!--/ko-->\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<div class="row">\r\n    <div class="large-12 columns">\r\n        <label class="error" data-bind="text: error"></label>\r\n    </div>\r\n</div>\r\n\r\n<div class="row">\r\n    <div class="large-12 columns">\r\n        <h3 class="text-center" data-bind="if: noItemsToShow">Nothing here!</h3>\r\n    </div>\r\n</div>\r\n\r\n<div data-bind="scroll: true, scrollOptions: { loadFunc: getMoreItems, offset: 125 }"></div>\r\n';});


define('text!views/shared/_title-bar.html',[],function () { return '<nav class="title-bar">\r\n    <ul>\r\n        <li class="lefty" data-bind="fastback: showBackButton">\r\n            <i class="fi-arrow-left" data-bind="css: { active: showBackButton }"></i>\r\n        </li>\r\n\r\n        <li>\r\n            <h1 data-bind="text: title"></h1>\r\n        </li>\r\n\r\n        <li class="righty">\r\n            <i class="fi-info" \r\n                data-bind="css: { active: undefined !== showInfoButton }, fastlink: \'/#/information/index\'"></i>\r\n        </li>\r\n    </ul>\r\n</nav>\r\n';});


